import React from "react";
import './admin-css/add-items.css';

export default function Add_items() {
    return(
        <>
            <div className="header">
                <div className="logo">
                    <h2>Dagos</h2>
                </div>
                <div className="menu">
                    <Square/>
                </div>
            </div>
        </>
    );
}
